import { FuseAnimateGroup } from '@fuse';
import React from 'react';

const PoweredByLinks = () => {
    return (
        <FuseAnimateGroup
            enter={{ animation: "transition.expandIn" }}
            className="hidden sm:flex items-center"
        >
        </FuseAnimateGroup>
    );
};

export default PoweredByLinks;
